  display: flex;
  flex-direction: column;
  padding: 0px;
  margin: 25px 10px 10px 10px;
  width: 25vw;
`
export const ThumbnailTextContainer = styled.div`
  display: flex;
  margin: 0px;
`
export const ProfileImage = styled.img`
width: 50`
